import React from "react";
import Style from "./SkillInfo.module.css";
import Css from "../../../Icons/css.png"
const SkillInfo = ({ imgSrc, info }) => {
  return (
    <div>
      <div>
        <img src={imgSrc} />
      </div>
      <span></span>
      <p>{info}</p>
    </div>
  );
};

export default SkillInfo;
